import React from 'react'
import axios from 'axios'

import Signin from '../components/Signin'

const submit = (e, formState, setErrorMessage, history) => {
  e.preventDefault()
  if (!formState.username || !formState.password) {
    setErrorMessage('Les champs ne doivent pas etre vide')
    return
  }
  axios({
    method: 'POST',
    url: 'https://api-football-v1.p.rapidapi.com/v2/',
    data: {
      username: formState.username,
      password: formState.password
    }
  })
    .then(res => {
      console.log(res)
      // localStorage.setItem('token', res.headers['x-access-X-RapidAPI-Key'])
      // history.push('/home')
    })
    .catch(err => {
      setErrorMessage('Une erreur est survenue')
      console.log(err)
    })
}

const LogFoot = props => {
  console.log('LogFoot -> props', props)
  return <Signin submit={submit}></Signin>
}

export default LogFoot
